"use strict";(self.webpackChunkdev_shipperhq=self.webpackChunkdev_shipperhq||[]).push([[4836],{7417:function(e){e.exports=JSON.parse('{"name":"introduction","permalink":"/docs/tags/introduction","docs":[{"id":"insight/how-shipping-insights-works","title":"How Shipping Insights Works","description":"ShipperHQ generates a significant amount of detail about each shipment for which it creates shipping rates and options each time an application calls the Rating API. Once the ShipperHQ account associated with the rating call has the Shipping Insights Advanced Feature enabled, ShipperHQ stores these shipment details for later retrieval with the Insight API.","permalink":"/docs/insight/how-shipping-insights-works"},{"id":"insight/overview","title":"Insight Overview","description":"There are many elements that impact both the shipping rates and options offered to eCommerce customers at checkout as well as how orders are fulfilled. For example, what carrier and service to use, what package or packages to use, what warehouse to ship from, etc. When ShipperHQ is used to produce shipping rates and options, it will determine many of these elements as part of its rating calculations. The Insight API gives you access to all of those details that can be used in a variety of scenarios including automating fulfillment.","permalink":"/docs/insight/overview"},{"id":"insight/quickstart","title":"Insight Quickstart","description":"This document is intended for technical architects and developers that need to integrate with ShipperHQ\u2019s Insight API to build their own integration to retrieve shipment details from ShipperHQ.","permalink":"/docs/insight/quickstart"},{"id":"insight/place-order","title":"PlaceOrder Mutation","description":"How Rating + Shipping Insights Works with the PlaceOrder mutation","permalink":"/docs/insight/place-order"},{"id":"rate/quickstart","title":"Rating Quickstart","description":"This document is intended for technical architects and developers that need to integrate with ShipperHQ\u2019s Insight API to build their own integration to retrieve shipment details from ShipperHQ.","permalink":"/docs/rate/quickstart"}],"allTagsPath":"/docs/tags"}')}}]);